import { Box, Typography } from "@mui/material";
import React from "react";

const DashHome = () => {
  return (
    <>
      <Box display={"flex"} gap={"20px"}>
        <Box display={"flex"} flexDirection={"column"} border={"1px solid red"}>
          <Typography fontSize={"50px"} padding={"20px"} fontWeight={600}>
            Worker
          </Typography>
          <Typography fontSize={"25px"} color="success">
            1000
          </Typography>
        </Box>
        <Box display={"flex"} flexDirection={"column"} border={"1px solid red"}>
          <Typography fontSize={"50px"} padding={"20px"}>
            Worker
          </Typography>
          <Typography fontSize={"25px"} color="success" marginLeft={"20px"}>
            1000
          </Typography>
        </Box>
      </Box>
    </>
  );
};

export default DashHome;
